import React, { useState } from "react";
import "./App.css";
import DarkModeToggle from "react-dark-mode-toggle";
import ReactPlayer from "react-player";

function App() {

  const [isDark, setIsDark] = useState(false)

  const hours = new Date().getHours()

  if (hours > 17) {
    setIsDark(true)
  }

  return (
    <div id="App">
      <div id="TopSection">
        <h1 id="CompanyName">Company</h1>
        <DarkModeToggle
          id="DarkModeToggle"
          onChange={setIsDark}
          checked={isDark}
          size={45}
        />
     </div>
     <div id="MiddleSection">
       <div id="VideoContainer">
        <ReactPlayer 
          url="https://vimeo.com/514419233"
          controls="true"
          playsinline="true"
        />
      </div>
     </div>
     <div id="BottomSection">
        <h3 id="CompanyType">Company LLC</h3>
        <h3 id="CompanyEmail">hi@company.com</h3>
     </div>
    </div>
  );
}

export default App;
